import React, { useState } from 'react';
import './UserDashboard.css';

export default function UserDashboard() {
  const [event, setEvent] = useState({
    title: '',
    image: '',
    date: '',
    location: '',
    description: '',
    volunteerPositions: [] // NEW: Added volunteer positions array
  });
  const [newPosition, setNewPosition] = useState(''); // NEW: For input field

  // NEW: Add volunteer position
  const addPosition = () => {
    if (newPosition.trim() && !event.volunteerPositions.includes(newPosition.trim())) {
      setEvent({
        ...event,
        volunteerPositions: [...event.volunteerPositions, newPosition.trim()]
      });
      setNewPosition('');
    }
  };

  // NEW: Remove volunteer position
  const removePosition = (index) => {
    const updated = [...event.volunteerPositions];
    updated.splice(index, 1);
    setEvent({...event, volunteerPositions: updated});
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Event submitted:', event);
    alert('Event created successfully!');
  };

  return (
    <div className="user-dashboard">
      <h2>Create New Event</h2>
      <form onSubmit={handleSubmit}>
        {/* Keep all your original fields exactly as they were */}
        <div className="form-group">
          <label>Event Title</label>
          <input
            type="text"
            value={event.title}
            onChange={(e) => setEvent({...event, title: e.target.value})}
            required
          />
        </div>

        <div className="form-group">
          <label>Image URL</label>
          <input
            type="url"
            value={event.image}
            onChange={(e) => setEvent({...event, image: e.target.value})}
            required
          />
        </div>

        <div className="form-group">
          <label>Date</label>
          <input
            type="date"
            value={event.date}
            onChange={(e) => setEvent({...event, date: e.target.value})}
            required
          />
        </div>

        <div className="form-group">
          <label>Location</label>
          <input
            type="text"
            value={event.location}
            onChange={(e) => setEvent({...event, location: e.target.value})}
            required
          />
        </div>

        <div className="form-group">
          <label>Description</label>
          <textarea
            value={event.description}
            onChange={(e) => setEvent({...event, description: e.target.value})}
            required
          />
        </div>

        {/* NEW: Volunteer Positions Section */}
        <div className="form-group">
          <label>Volunteer Positions (optional)</label>
          <div className="position-input">
            <input
              type="text"
              value={newPosition}
              onChange={(e) => setNewPosition(e.target.value)}
              placeholder="Add volunteer role (e.g., 'Registration')"
            />
            <button type="button" onClick={addPosition}>Add</button>
          </div>
          <div className="positions-list">
            {event.volunteerPositions.map((pos, index) => (
              <div key={index} className="position-tag">
                {pos}
                <button 
                  type="button" 
                  onClick={() => removePosition(index)}
                  className="remove-position"
                >
                  Ã—
                </button>
              </div>
            ))}
          </div>
        </div>

        <button type="submit">Create Event</button>
      </form>
    </div>
  );
}
